import { createMuiTheme } from '@material-ui/core/styles';

const blue = "#1891FC";
const white = "#FFFFFF";

export default createMuiTheme({
  palette: {
    common: {
      blue: `${blue}`,
      white: `${white}`,
    },
    primary: {
      main: `${blue}`
    },
    secondary: {
      main: `${white}`
    }
  },
  typography: {
    tab: {
      fontweight: 300,
      color: "#1891FC",
      fontFamily: 'Myriad Pro',
      fontSize: '1.1rem',
      textTransform: "none"
    },
    h2: {
      fontFamily: 'Myriad Pro',
      fontWeight: 300,
      fontSize: '2.5rem',
      color: `${blue}`
    }
  },

});
